import { useState } from "react";
import { Link } from "react-router-dom";
import { RESPONSE } from "../App";
import "./styles.css";

export const Sushi = () => {

  type SUSHIDATA = {
    id:string
    longitude:string
    latitude:string
    type:string
    tunaId:string
  };

  const [sushiData, setSushiData] = useState<SUSHIDATA | null>(null);

  const [response, setResponse] = useState<RESPONSE | undefined>(undefined);

  const handleData = async () => {
    console.log(sushiData)
    const _tx = await fetch('http://localhost:5000/api/addSushi',{
      method:'POST',
      body:JSON.stringify(sushiData),
      headers: {
        'Content-Type': 'application/json',
        'Connection': 'keep-alive',
        'Accept': '*/*',
    },
    });
    setResponse(await _tx.json());
  };

  return (
    <div>
      <h1>Sushi</h1>
      <div className="form">
        <input
          name="id"
          type="text"
          className="feedback-input"
          placeholder="Processed ID"
          onChange={(e) => setSushiData((val:any) => ({
            ...val,id:e.target.value
          }))}
        />
        <input
          name="latitude"
          type="text"
          className="feedback-input"
          placeholder="Latitiude"
          onChange={(e) => setSushiData((val:any) => ({
            ...val,latitude:e.target.value
          }))}/>
        <input
          name="longitude"
          type="text"
          className="feedback-input"
          placeholder="Longitude"
          onChange={(e) => setSushiData((val:any) => ({
            ...val,longitude:e.target.value
          }))}/>
        <input
          name="type"
          type="text"
          className="feedback-input"
          placeholder="Type"
          onChange={(e) => setSushiData((val:any) => ({
            ...val,type:e.target.value
          }))}/>
        <input
          name="tunaId"
          type="text"
          className="feedback-input"
          placeholder="TunaID"
          onChange={(e) => setSushiData((val:any) => ({
            ...val,tunaId:e.target.value
          }))}/>
        <button onClick={handleData}>ADD</button>
      </div>

      <Link to="/">Home</Link>
    </div>
  );
};
